import React, { Component } from 'react'
import { programs } from './UserFunctions'
import "./Programs.css"

class ProgramsList extends Component {
    constructor() {
        super();
        this.state = {
            initial: ''
        }

    }         
    componentDidMount() {
        console.log('mounted')
        //const apidata = {
        //    initial: this.state.initial
        //}

        programs(initial).then(res => {

            if(!res.error) {
                console.log(res)

            } else{
                console.log("error in axios request: apidata")
            }     
        })

    }

    render(){
        return (<h1>Hello</h1>)
    }
}

export default ProgramsList
